(508, 'Kichi Kichi', 'Nổi bật trong vô số những nhà hàng ngon Hà Nội, Olearys mang hình thức quán bar thể thao kết hợp ẩm thực Á Âu đặc sắc', 538, NULL, NULL, 1, 508, '1710993321', NULL, NULL),
(509, 'GoGi', 'mang đến cho thực khách Hà thành những trải nghiệm đặc biệt lý thú', 465, NULL, NULL, 0, 509, '1790620609', NULL, NULL),
(510, 'Vịt nướng Vân Đình', 'Là thực khách của Olearys bạn sẽ được trải nghiệm thực đơn hơn 100 món ngon hiếm có trong một không gian sang trọng, lịch lãm những cũng không kém phần trẻ trung, năng động.', 327, NULL, NULL, 0, 510, '1601815031', NULL, NULL),
(511, 'Lẩu nấm Hàn Quốc', 'Nếu đã chán các món nướng, lẩu hay buffet Nhật, Hàn, hãy để những món Á Âu tại Pepperon', 62, NULL, NULL, 0, 511, '1333827444', NULL, NULL),
(512, 'Chả cá Lã Vọng', 'Nhắc tới hải sản tươi sống với chất lượng cao cấp hàng đầu không thể không nhắc tới Thế Giới Hải Sản', 59, NULL, NULL, 1, 512, '1418964654', NULL, NULL),
(513, 'Nhà hàng Hoàng Hôn', 'chuỗi nhà hàng uy tín lâu đời, được nhiều người tin tưởng, yêu quý', 144, NULL, NULL, 1, 513, '1776356492', NULL, NULL),
(514, 'Nhà hàng Trần Khải', 'Bề bề tươi sống, tôm hùm bông thơm ngon, hàu sữa ngầy ngậy,... ', 488, NULL, NULL, 1, 514, '1196615316', NULL, NULL),
(515, 'Nhà hàng Món ăn quê hương', 'Phương Nam là chuỗi nhà hàng chuyên phục vụ món Nam Bộ nổi tiếng mà phàm những ai yêu mến hương vị món Nam đều không thể không biết', 540, NULL, NULL, 0, 515, '1748339526', NULL, NULL),
